<?php

namespace Tests\Unit;

use App\Jobs\EmailSender;
use PHPUnit\Framework\TestCase;

class EmailSenderJobTest extends TestCase
{
    /**
     * A basic unit test example.
     *
     * @return void
     */
    public function dispatch_send_email_job()
    {
        $emailsData = [
            [
                'recipient' => 'ma8h7er@gmail.com',
                'subject' => 'Test email',
                'body' => '<p>Test email body</p>',
                'attachments' => [
                    [
                        'name' => 'Canada Flag',
                        'file' => 'data:image/jpeg;base64,'
                    ]
                ]
            ]
        ];
        $job = new EmailSender($emailsData);
        $job->handle();
        $this->assertTrue(true);
    }
}
